import { AfterViewInit, Component, OnInit, ViewChild } from '@angular/core';
import { FormGroup } from '@angular/forms';
import { FormControl } from '@angular/forms';
import { FormBuilder } from '@angular/forms';
import { ApiService } from '../api.service';

@Component({
  selector: 'app-dashboard',
  templateUrl: './dashboard.component.html',
  styleUrls: ['./dashboard.component.css']
})
export class DashboardComponent implements AfterViewInit, OnInit  {

  @ViewChild('tempbutton') buttontemp:any;
  title = 'ClientCrud';


  registrationForm : FormGroup;









 constructor(private fb:FormBuilder ,
  private  _ApiService:ApiService){
  this.registrationForm = fb.group({});

 }






 ngOnInit(): void{
  this.registrationForm = this.fb.group({
    name: this.fb.group(""),
    job_title: this.fb.group(""),
    bio:this.fb.group(""),
    email:this.fb.group(""),
    phone:this.fb.group(""),
    birthday:this.fb.group(""),
    gender:this.fb.group(""),
    profile_background_color:this.fb.group(""),
    active_profile_background:this.fb.group(""),
    is_public:this.fb.group(""),


  });


   this._ApiService.getAllLinks().subscribe(res=> {
    console.log(res);

   })


 }

ngAfterViewInit(): void {
  this.buttontemp.nativeElement.click();
}


}
